import logo from './logo.svg';
import './App.css';
import './components/Header.css';
import './components/Technologies.css';
import './components/Table.css';
import Technologies from './components/Technologies';
import Header from './components/Header';
import Table from './components/Table';


let response;
try{
  response = await fetch('https://dummyjson.com/users/');
}catch(error){
  console.log('Возникла ошибка: ' + error.message);
}

let data_1 = await response.json();
let array = data_1['users'];
console.log(array);

const unnecessaryKeys = ['bank', 'bloodGroup', 'birthDate', 
                        'company', 'crypto', 'domain', 'ein', 'eyeColor', 
                        'hair', 'height', 'image', 'ip', 'macAddress', 
                        'password', 'ssn', 'university', 'userAgent', 
                        'username', 'weight'];

const removeKey = (array, keys) => {
  return array.map(obj => {
    const newObj = { ...obj }; // Создаем копию объекта
    keys.forEach(key => {
      delete newObj[key];
    });
    return newObj;
  });
};

removeKey(array, unnecessaryKeys);
let data = array;

const App = () => {
  return (
    <div className="mainInfo">
      <div className="headerInfo"><Header /></div>
      <div className="table"><Table data={data}/></div>
      <div className="techInfo"><Technologies /></div>
    </div>
  );
}

export default App;
